const Card = (props) => {
	return(
		
		<div className='bg-light-green dib br4 pa3 ma2 grow bw2 shadow-5'>
			<img alt='robots' src='https://robohash.org/batman?size=200x200' />
			<div>
				<h1>{props.robo-name}</h1>
				<p>{props.robo-email}</p>
			</div>
		</div>
	)
};

export default Card
